[{"location":"","page":"Home","title":"Home","text":"CurrentModule = EduMaterialModels","category":"page"},{"location":"#EduMaterialModels","page":"Home","title":"EduMaterialModels","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for EduMaterialModels.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [EduMaterialModels]","category":"page"},{"location":"#EduMaterialModels.AbstractPlastic","page":"Home","title":"EduMaterialModels.AbstractPlastic","text":"AbstractPlastic\n\nAn AbstractPlastic materials have the same state variables, PlasticState, unknowns for the local equation system [Δλ, ϵp, κ, β], and von mises yield criterion. They may have different evolution laws.\n\n\n\n\n\n","category":"type"},{"location":"#EduMaterialModels.J2Plasticity","page":"Home","title":"EduMaterialModels.J2Plasticity","text":"J2Plasticity(;e, Y0, Hiso, κ∞, Hkin, β∞)\n\nThe J2Plasticity material model assumes linear elasticity combined  with rate independent von mises plasticity. Nonlinear isotropic (Voce) and kinematic (Armstrong-Frederick) hardening  are included as well.\n\n\n\n\n\n","category":"type"},{"location":"#EduMaterialModels.J2ViscoPlasticity","page":"Home","title":"EduMaterialModels.J2ViscoPlasticity","text":"J2ViscoPlasticity(;e, Y0, Hiso, κ∞, Hkin, β∞)\n\nThe J2ViscoPlasticity material model assumes linear elasticity combined  with rate dependent (Norton-type) von mises plasticity. Nonlinear isotropic (Voce) and kinematic (Armstrong-Frederick) hardening  are included as well. Specifically, the overstress function is \n\neta(Phi) = left fraclangle Phi rangleY_0right^n\n\n\n\n\n\n","category":"type"},{"location":"#EduMaterialModels.LinearIsotropicElasticity","page":"Home","title":"EduMaterialModels.LinearIsotropicElasticity","text":"LinearIsotropicElasticity(;kwargs...)\n\nConstruct a linear, isotropic, elastic material.  The following pairs of properties can be given as keyword arguments:\n\nG, K: Shear and bulk modulus \nE, G: Young's and shear modulus \nE, ν: Young's modulus and Poisson's ratio \nE, K: Young's and bulk modulus\n\n\n\n\n\n","category":"type"},{"location":"#EduMaterialModels.Zener1D","page":"Home","title":"EduMaterialModels.Zener1D","text":"Zener1D(;E1, E2, η)\n\nSpecial implementation of the Zener material model, which only works  for uniaxial stress, i.e. when stress_state=MaterialModelsBase.UniaxialStress() is given to material_response. \n\n\n\n\n\n","category":"type"},{"location":"#EduMaterialModels.simulate_response-Tuple{MaterialModelsBase.AbstractMaterial, Any, Any, Any}","page":"Home","title":"EduMaterialModels.simulate_response","text":"A simple driver to simulate a response for a given material, m, a stress_state<:MaterialModelsBase.AbstractStressState, a strain history  strain_history::Vector{<:AbstractTensor}, and time history,  timevector::Vector{<:Number}. \n\n\n\n\n\n","category":"method"},{"location":"#EduMaterialModels.tosmandel-Tuple{Union{Tensors.Tensor{2}, Tensors.Tensor{4}}}","page":"Home","title":"EduMaterialModels.tosmandel","text":"tosmandel(A::Union{SecondOrderTensor,FourthOrderTensor})\n\nSVector version of tomandel: converts the tensor A to a mandel (offdiagscale=√2 for symmetric tensors) SVector with the default voigt ordering. See also tosvoigt.  The output can be converted back to a tensor with the standard frommandel function.\n\n\n\n\n\n","category":"method"},{"location":"#EduMaterialModels.tosvoigt-Tuple{Union{Tensors.Tensor{2}, Tensors.Tensor{4}}}","page":"Home","title":"EduMaterialModels.tosvoigt","text":"tosvoigt(A::Union{SecondOrderTensor,FourthOrderTensor}; offdiagscale=1)\n\nSVector version of tovoigt: converts the tensor A to a voigt SVector with the default voigt ordering.  The keyword offdiagscale is only available for symmetric tensors. See also tosmandel. The output can be converted back to a tensor with the standard fromvoigt function.\n\n\n\n\n\n","category":"method"}]
